import React, { useState } from 'react';
import { X, Eye, EyeOff } from 'lucide-react';

const LoginModal = ({ isOpen, onClose }) => {
  const [showPassword, setShowPassword] = useState(false);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  if (!isOpen) return null;

  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex justify-center items-center z-50">
      <div className="bg-white rounded-lg p-8 max-w-md w-full">
        <div className="flex justify-between items-center mb-4">
          <h2 className="text-2xl font-bold">Log in to Tinoto</h2>
          <button onClick={onClose} className="text-gray-500 hover:text-gray-700">
            <X size={24} />
          </button>
        </div>

        <button className="w-full bg-blue-600 text-white rounded-md py-2 mb-2 flex items-center justify-center">
          <span className="mr-2">f</span>
          Log in with Facebook
        </button>
        <button className="w-full border border-gray-300 rounded-md py-2 mb-2 flex items-center justify-center">
          <span className="mr-2">G</span>
          Log in with Google
        </button>
        <button className="w-full border border-gray-300 rounded-md py-2 mb-4 flex items-center justify-center">
          <span className="mr-2">üçé</span>
          Log in with Apple
        </button>

        <div className="text-center mb-4">or</div>

        <input
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          className="w-full border border-gray-300 rounded-md py-2 px-3 mb-2"
        />
        <div className="relative">
          <input
            type={showPassword ? "text" : "password"}
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            className="w-full border border-gray-300 rounded-md py-2 px-3 mb-2"
          />
          <button
            onClick={() => setShowPassword(!showPassword)}
            className="absolute right-3 top-2 text-gray-500"
          >
            {showPassword ? <EyeOff size={20} /> : <Eye size={20} />}
          </button>
        </div>

        <div className="text-right mb-4">
          <a href="#" className="text-blue-600 text-sm">Forgot password</a>
        </div>

        <button className="w-full bg-blue-600 text-white rounded-md py-2 mb-4">
          Log in
        </button>

        <div className="text-center">
          Don't have an account yet? <a href="#" className="text-blue-600">Sign up</a>
        </div>
      </div>
    </div>
  );
};

export default LoginModal;
